import './App.css'
import Navbar from './components/Navbar'
import Home from './components/Home'

const AboutView = () => {
  return(
    <h2>About Us</h2>
  )
}

function App() {
  return (
    <div className="App">
      <Navbar />
      <Home />
      <AboutView />
    </div>
  );
}

export default App;
